import React from "react";

export default function Filme({movie}) {
  console.log(movie);
  return (
    <>
  {
    !movie ? null : (
    <div className="modal-container">
          <h2 className="modal_h2">{movie.titulo}</h2>
          <h2>{movie.titulo2}</h2>
          <img src={movie.capaDoFilme2} alt="capa do filme" className="img-modal"/>
          <h3>Sinopse:</h3>
          <p>{movie.sinopse}</p>
          {movie.trailer}   
    </div>  
    )
  }
  </>
  );
}
